import { useState } from 'react';

const Form = ({ onSubmit }) => {
const [name, setName] = useState('');
const [email, setEmail] = useState('');
const [education, setEducation] = useState([]);
const [experience, setExperience] = useState([]);

const handleEducationChange = (index, field, value) => {
const newEducation = [...education];
newEducation[index][field] = value;
setEducation(newEducation);
};

const handleExperienceChange = (index, field, value) => {
const newExperience = [...experience];
newExperience[index][field] = value;
setExperience(newExperience);
};

const handleAddEducation = () => {
setEducation([...education, {
institution: '',
degree: '',
fieldOfStudy: '',
startDate: '',
endDate: ''
}]);
};

const handleAddExperience = () => {
setExperience([...experience, {
title: '',
company: '',
startDate: '',
endDate: '',
description: ''
}]);
};

const handleSubmit = (event) => {
event.preventDefault();
const userData = {
name,
email,
education,
experience
};
onSubmit(userData);
};

return (
<form onSubmit={handleSubmit}>
<label>
Name:
<input type="text" value={name} onChange={(event) => setName(event.target.value)} />
</label>
<label>
Email:
<input type="email" value={email} onChange={(event) => setEmail(event.target.value)} />
</label>
<h2>Education</h2>
{education.map((edu, index) => (
<div key={index}>
<label>
Institution:
<input type="text" value={edu.institution} onChange={(event) => handleEducationChange(index, 'institution', event.target.value)} />
</label>
<label>
Degree:
<input type="text" value={edu.degree} onChange={(event) => handleEducationChange(index, 'degree', event.target.value)} />
</label>
<label>
Field of Study:
<input type="text" value={edu.fieldOfStudy} onChange={(event) => handleEducationChange(index, 'fieldOfStudy', event.target.value)} />
</label>
<label>
Start Date:
<input type="date" value={edu.startDate} onChange={(event) => handleEducationChange(index, 'startDate', event.target.value)} />
</label>
<label>
End Date:
<input type="date" value={edu.endDate} onChange={(event) => handleEducationChange(index, 'endDate', event.target.value)} />
</label>
</div>
))}
<button type="button" onClick={handleAddEducation}>Add Education</button>
<h2>Experience</h2>
{experience.map((exp, index) => (
<div key={index}>
<label>
Title:
<input type="text" value={exp.title} onChange={(event) => handleExperienceChange(index, 'title', event.target.value)} />
</label>
<label>
Company:
<input type="text" value={exp.company} onChange={(event) => handleExperienceChange(index, 'company', event.target.value)} />
</label>
<label>
Start Date:
<input type="date" value={exp.startDate} onChange={(event) => handleExperienceChange(index, 'startDate', event.target.value)} />
</label>
<label>
End Date:
<input type="date" value={exp.endDate} onChange={(event) => handleExperienceChange(index, 'endDate', event.target.value)} />
</label>
<label>
Description:
<textarea value={exp.description} onChange={(event) => handleExperienceChange(index, 'description', event.target.value)} />
</label>
</div>
))}
<button type="button" onClick={handleAddExperience}>Add Experience</button>
<button type="submit">Submit</button>
</form>
);
};

export default Form
